import PropTypes from "prop-types";
import Button from "./Button";

const Header = ({ title }) => {
  return (
    <>
      <h1>{title}</h1>
      <Button color="green" text="Add" />
    </>
  );
};

Header.defaultProps = {
  title: "Task Tracker",
};

Header.propTypes = {
  title: PropTypes.string,
};

export default Header;
